class Solution:
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def solve(self, board):
        if board == []:
            return
        stack = []
        width = len(board)
        length = len(board[0])
        for i in range(width):
            if board[i][0] == 'O':
                stack.append([i,0])
                board[i][0] = 't'
            if board[i][length-1] == 'O':
                stack.append([i,length-1])
                board[i][length-1] = 't'
        for i in range(length):
            if board[0][i] == 'O':
                stack.append([0,i])
                board[0][i] = 't'
            if board[width-1][i] == 'O':
                stack.append([width-1,i])
                board[width-1][i] = 't'
        while stack != []:
            position = stack.pop()
            i = position[0]
            j = position[1]
            if(j<length-1 and board[i][j+1] == 'O'):
                board[i][j+1] ='t'
                stack.append([i,j+1])
            if(j>0 and board[i][j-1] == 'O'):
                board[i][j-1] ='t'
                stack.append([i,j-1])
            if(i<width-1 and board[i+1][j] == 'O'):
                board[i+1][j] ='t'
                stack.append([i+1,j])
            if(i > 0 and board[i-1][j] == 'O'):
                board[i-1][j] ='t'
                stack.append([i-1,j])
        for i in range(width):
            for j in range(length):
                if(board[i][j] == 'O'):
                    board[i][j] = 'X'
                elif(board[i][j] == 't'):
                    board[i][j] = 'O'
